CREATE TABLE stack_some_table ( stack_some_table_uu UUID PRIMARY KEY DEFAULT gen_random_uuid(), created TIMESTAMP NOT NULL DEFAULT now(), created_by_uu uuid NOT NULL, updated TIMESTAMP NOT NULL DEFAULT now(), updated_by_uu uuid NOT NULL, search_key TEXT NOT NULL, value TEXT NOT NULL, name TEXT NOT NULL, description TEXT, is_default BOOLEAN DEFAULT false, is_processed BOOLEAN DEFAULT false, is_active BOOLEAN DEFAULT true, CONSTRAINT fk_some_table_created_by FOREIGN KEY (created_by_uu) REFERENCES stack_user(stack_user_uu), CONSTRAINT fk_some_table_updated_by FOREIGN KEY (updated_by_uu) REFERENCES stack_user(stack_user_uu)
);
COMMENT ON TABLE stack_some_table IS 'Table that contains some data';
